import React, { useEffect, useState } from "react";
import s from "./Cars.module.css";
import pic1 from "./woodoo-crop-300x300.jpg";
import pic2 from "./bd676c9e9c2f4213e21ffb367de77e93.jpg";
import pic3 from "./crop3.jpg";
import { NavLink } from "react-router-dom";
import Booking from "../OnlineBooking/Booking";
import { useHistory } from 'react-router-dom';




export default function Cars(props) {
    const history = useHistory();
    const [cars, setCars] = useState([]);

    async function getCars(e){
        e.preventDefault();

        let res = await fetch("https://localhost:44312/api/Car", {
            method: 'GET',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
                "Authorization": "Bearer "+ localStorage.getItem("tok"),
            },
        });
        setCars();
        console.log(cars);
        console.log(res);
        console.log(res.status);
        if(res.status === 200){
            history.push("/login")
        }


        res = await res.json();
        //console.log(res);

        let names = [];

       for(var i in res ){
           names[i] = res[i];
           
       }
       setCars(names);
       console.log(cars);
       console.log(names);
       localStorage.setItem("cars", JSON.stringify(names));
       console.log(localStorage.getItem("cars"))
       





    }

       
       
    
   
    function printCars(){
        const cars = localStorage.getItem("cars");
        const listItems = [cars].map((d)=> <li key={d.car_id}>{d.car_id}</li>);
        console.log(listItems);
        return (
            <div>
                {listItems}
            </div>
            
      

        );
    }
    
    return (
        <div>
            <button onClick={getCars} className = {s.button}>Получить машины</button>
            <button onClick={printCars} className = {s.button}>Печать</button>

        </div>
    );
}
